import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Average(){
    return(
    <div>
        <h1>Kalkulator średniego spalania na 100 km</h1>
        <div>{fuel}</div>
        <div>{km}</div>
        <div>{cost}></div>
        <button>Oblicz</button>
    </div>
    ); 
}

function Cost(){
    return(
    <div>
        <h1>Kalkulator kosztu przejechania trasy</h1>
        <div>Długość planowanej trasy w kilometrach: <input type="number" name="km"/></div>
        <div>Średnie spalanie w litrach na 100 km: <input type="number" name="fuel"/></div>
        <div>Cena litra paliwa: <input type="number" name="cost"/></div>
        <button>Oblicz</button>

    </div>
    ); 

}


ReactDOM.render(<Average 
    fuel="Spalone paliwo w litrach:"
    km='Ilość przejechanych kilometrów:'
    cost='Cena litra paliwa (opcjonalne):'
/>, document.getElementById('root'));
